import React, { Component } from 'react'
import home from "./images/home.jpg"

export default class Home extends Component {
    render() {
        return (
            <div>
                <div id="home-session">
                    <img src={home} alt="" />
                    <div className="contaner">
                        <h1>hello</h1>
                    </div>
                </div>
            </div>
        )
    }
}
